import{_ as t,c as e,o as n,a}from"./app.5f69941c.js";var o="/assets/asymptotic-notations.a68ae990.png";const $='{"title":"Asymptotic Analysis","description":"","frontmatter":{},"headers":[{"level":3,"title":"$\\\\Theta(g(n))$ - Set of functions that describe lower and upper bounds","slug":"theta-g-n-set-of-functions-that-describe-lower-and-upper-bounds"},{"level":3,"title":"$O(g(n))$ - Set of functions that describe Upper Bound","slug":"o-g-n-set-of-functions-that-describe-upper-bound"},{"level":3,"title":"$\\\\Omega(g(n))$ - Set of functions that describe Lower Bound","slug":"omega-g-n-set-of-functions-that-describe-lower-bound"}],"relativePath":"Algorithms/Asymptotic Analysis.md"}',s={name:"Algorithms/Asymptotic Analysis.md"},i=a('<h1 id="asymptotic-analysis" tabindex="-1">Asymptotic Analysis <a class="header-anchor" href="#asymptotic-analysis" aria-hidden="true">#</a></h1><p>20210210201718</p><p>Source: Introduction to Algorithms - CLRS</p><p>To describe the upper and lower bounds of a function $f(n)$ for $n &gt; n_0$, we have three different notations</p><h3 id="theta-g-n-set-of-functions-that-describe-lower-and-upper-bounds" tabindex="-1">$\\Theta(g(n))$ - Set of functions that describe lower and upper bounds <a class="header-anchor" href="#theta-g-n-set-of-functions-that-describe-lower-and-upper-bounds" aria-hidden="true">#</a></h3><ul><li>Theta Notation?</li><li>Bounds the function</li><li>$f(n) = \\Theta(g(n))$ means that there exist some constant $c_1$ and $c_2$ such that $c_1g(n) &lt; f(n) &lt; c_2g(n)$ for all $n &gt; n_0$</li></ul><h3 id="o-g-n-set-of-functions-that-describe-upper-bound" tabindex="-1">$O(g(n))$ - Set of functions that describe Upper Bound <a class="header-anchor" href="#o-g-n-set-of-functions-that-describe-upper-bound" aria-hidden="true">#</a></h3><ul><li>Big-Oh notation</li><li>$f(n) = O(g(n))$ means that there exist some constant $c$ such that $f(n) &lt; cg(n)$ for all $n &gt; n_0$</li></ul><h3 id="omega-g-n-set-of-functions-that-describe-lower-bound" tabindex="-1">$\\Omega(g(n))$ - Set of functions that describe Lower Bound <a class="header-anchor" href="#omega-g-n-set-of-functions-that-describe-lower-bound" aria-hidden="true">#</a></h3><ul><li>Big-Omega notation</li><li>$f(n) = \\Omega(g(n))$ means that there exist some constant $c$ such that $f(n) &gt; cg(n)$ for all $n &gt; n_0$</li></ul><p><img src="'+o+'" alt="asymptotic-notations.png"></p>',11),r=[i];function c(d,l,h,u,f,p){return n(),e("div",null,r)}var _=t(s,[["render",c]]);export{$ as __pageData,_ as default};
